import "./App.css";
import React from "react";
import {
  Switch,
  BrowserRouter as Router,
  Route,
  Redirect,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
      <Route path="/test1-control-panel" element={<App />} />
      </Switch>
    </Router>
  );
}
